    const {friendList} = useContext(FriendContext)
    return friendList.length > 0 ? (
            <VStack>
                <TabPanels>
                    <TabPanel>
                        Friend one
                    </TabPanel>
                    <TabPanel>
                        Friend two
                    </TabPanel>
                </TabPanels>
            </VStack>
        ) :
        (
            <VStack justify={"center"} pt={"5rem"} w={"100vw"} textAlign={"center"} fontSize={"large"}>
                <TabPanels>
                    <Text>No friends</Text>
                </TabPanels>
            </VStack>
        )
};
